import { Button, FormControl, TextField } from "@mui/material";
import axios from "axios";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const PotentialPassword = () => {
  const [potentialPassText, setPotentialPassText] = useState("");
  const [message, setMessage] = useState("");

  const navigate = useNavigate();

  const submitData = (e) => {
    e.preventDefault();
    axios
      .post("https://nr5ieu7dcc.execute-api.us-east-1.amazonaws.com/abcd/abc", {
        potentialpassword: potentialPassText,
        "http-method": "POST",
        "resource-path": "/checkpotentialpassword",
      })
      .then((data) => {
        console.log(data.data);
        setMessage(data.data.body.message);
      })
      .catch((err) => {
        alert(err);
      });
  };

  const generateSecuredPasswords = (e) => {
    e.preventDefault();
    navigate("/GeneratedPassword");
  };

  return (
    <>
      <div
        style={{
          backgroundColor: "black",
          height: 840,
        }}
      >
        <img
          src={
            "https://igloodoor.s3.us-east-1.amazonaws.com/igloodoor%20logo.jpg?response-content-disposition=inline&X-Amz-Security-Token=IQoJb3JpZ2luX2VjEAQaCXVzLWVhc3QtMSJIMEYCIQChn8V4DmFfzPxy1b92MB%2B84SsmYlgt4RjutQCO6XtEaQIhAKma87NSFn4HV69ZMPVf%2BfvxsYtg2smar3frlIpxIor8Ku0CCJz%2F%2F%2F%2F%2F%2F%2F%2F%2F%2FwEQABoMNTgzMjg5MzczNDU3Igz%2BgxGuuT615EMlL8AqwQIJiwzH5qfgcdVKefQPwzXxCo3NJ2BjwgXnS6CK9PQWbxWuYbPCIqiUYVYAefkByWoDUCJNlhuOpOOMT09M5RdRUCk0noubP4tinV4vWNH%2BGlHMt8VUyOxNF53OKdd2Uijv6z7UM8HIJiFxP9vwAPL2M%2BbJbbbzChVaVEehcB1ey6%2BL9i2t0AujDXr29jkO1teYfoN1pCmEFMUQ3788WESUEHfI42MNV85DLRbx3NUEm8dAcynq9XI1fVB%2F35OpkWm1%2BG6V7N%2BFHmy%2BkHdpK00%2F8VYUqB6mwaBUUfzB0ee5gKWEgJnva4NUYhdr0Ky39y5g%2FuiD0nr6v%2BYftfkbKO0M3hHXDumal6uchOi5YqsgYF27IAjrwXong2F5ydKLfDE70j6Di4fkIHH7W%2FrPjtGoOZbQv%2BNf4MY%2F%2BnfjwpbLC44w7%2BSykgY6sgL7LZwVT%2BSuuyUSX9OuFb30AquWYaWj4dzjmwHcBPiIAHqBUABUrC8CB%2BqsT7n3fx0DiuYb3G8PluJhTzMb6q8OMF2ulp9ozPCz%2B4dWXZ1kTNpvTfVj%2BQffzP0Bwsa45igzB1bITUoma6PQ0hhPo2ztRYsFEnu72PgWaGwnFCkFFkn8HpgiFRCDWljTVPZ4GTpFugfL09bJrmMGOLQH7yIs0z8ABI3B8M%2Bpx8slunXDZvuYhjjVSAYfLNpzFVsBrjBJnzlBTKweInOAHSC2oFUCthrsMI07RxJ4XVN9UhSEr26mhyysIsif3VQxfRP9gKReLSm%2FUPucRnzOhPxbHDkOJWfS%2FBEDEDxkAHErrtQy0nlmIW1WLDDJyTysYGYC%2FPSdkXda7VmNp3VM0amqrmNWvNk%3D&X-Amz-Algorithm=AWS4-HMAC-SHA256&X-Amz-Date=20220406T031100Z&X-Amz-SignedHeaders=host&X-Amz-Expires=300&X-Amz-Credential=ASIAYPTWBQMIQW6RJURG%2F20220406%2Fus-east-1%2Fs3%2Faws4_request&X-Amz-Signature=b1f6dfa8402ed6213a6942773499ce5164bf24a74542bd969ebed48ecaf5bc41"
